import React from 'react';
import './add-component.css'
const AddComponent = () => {
    return (
        <button type='button'
                    className='btn .btn-primary btn-lg float-center'>
                        Add new element    
                        <i className='fa fa-plus'></i>
                    
                </button>
        )
}
export default AddComponent;
